import React, { Component } from 'react';

import CalcBtn from './CalcBtn';

class App extends Component {

  renderCalcBtn(e){
    return(
      <div className="BtnWrap">
        <CalcBtn className={e}/>
      </div>
    )
  }

  render(){
    return(
      <div className="box-wrap">
        {renderCalcBtn(e)}
      </div>
    )
  }

}
export default App;
